attrs.script:
write-host "Starting"
$DomainUsername = "@@{DomainCreds.username}@@";
$DomainPassword = "@@{DomainCreds.secret}@@";
$MachineName = "@@{MachineName}@@";
$domainname = "@@{DomainFQDN}@@";

write-host "Using $DomainUsername user"
write-host "using $MachineName machine name"

$Securepass = ConvertTo-SecureString -asPlainText -Force -String $DomainPassword;
$credential = New-Object System.Management.Automation.PSCredential("$($DomainName)\$($DomainUsername)",$Securepass);

try {;
  Rename-Computer -NewName $MachineName -force -confirm:0;
  $restart = 1;
} catch {;
  write-host "Rename computer failed.";
};
try {;
  write-host "Joining machine to $domainname using ";
  Add-computer -DomainName $DomainName -Credential $credential -force -Options JoinWithNewName,AccountCreate;
  $restart = 1;
} catch {
  if ((Get-WmiObject -Class Win32_ComputerSystem).PartOfDomain){;
    write-host "Machine is already part of the domain.";
  } else {;
    write-host "Error joining machine to the domain. Machine is not joined.";
  };
};
if ($restart -eq 1){;
  shutdown -r -t 20 -f;
};

$DomainUsername = "@@{DomainCreds.username}@@";
$DomainPassword = "@@{DomainCreds.secret}@@"; 
$domainname = "@@{DomainFQDN}@@";
$Securepass = ConvertTo-SecureString -asPlainText -Force -String $DomainPassword;
$credential = New-Object System.Management.Automation.PSCredential("$($DomainName)\$($DomainUsername)",$Securepass);
$domainuser = "$($DomainName)\$($DomainUsername)"
$file = "C:\windows\temp\AddNLB.ps1"
write '$interface = get-netadapter' | out-file $file
write '$nlbname = "@@{IISAppName}@@.@@{DomainFQDN}@@"' | out-file $file -append
write '$CLIP = "@@{NLBIP}@@"' | out-file $file -append
write '$IP = get-NetIPAddress | where {$_.InterfaceAlias -eq $interface.name -and $_.AddressFamily -eq "IPv4"}' | out-file $file -append
write '$detail = Get-NetIPConfiguration' | out-file $file -append
write '$nic_configuration = gwmi -computer .  -class "win32_networkadapterconfiguration" | Where-Object {$_.defaultIPGateway -ne $null}' | out-file $file -append
write '$subnet = $nic_configuration.ipsubnet | where {$_ -match "\."}' | out-file $file -append
write '$prefix = $IP.prefixlength' | out-file $file -append
write '$nodename = Get-WMIObject Win32_ComputerSystem | Select-Object -ExpandProperty name;' | out-file $file -append
write 'try {;' | out-file $file -append
write '  $cluster = Get-NlbCluster $CLIP;' | out-file $file -append
write '} catch {;' | out-file $file -append
write '  write-host "NLB does not exist yet, creating.";' | out-file $file -append
write '};' | out-file $file -append
write 'if ($cluster){;' | out-file $file -append
write '  $cluster | Add-NlbClusterNode -NewNodeName $nodename -NewNodeInterface $interface.name;' | out-file $file -append
write '} else {;' | out-file $file -append
write '  $hide = New-NlbCluster -ClusterName $nlbname -InterfaceName $($interface.name) -ClusterPrimaryIP $CLIP -SubnetMask $subnet -OperationMode "Unicast" -ea:0;' | out-file $file -append
write '};' | out-file $file -append
write 'write-host "Done"' | out-file $file -append
$jobname = "CreateSetNLB";
$script = "C:\windows\temp\AddNLB.ps1"
$action = New-ScheduledTaskAction -Execute "$pshome\powershell.exe" -Argument  "$script > c:\windows\temp\changeNLB.log";
$duration = ([timeSpan]::maxvalue);
$repeat = (New-TimeSpan -minutes 1);
$trigger =New-ScheduledTaskTrigger -Once -At (Get-Date).Date -RepetitionInterval $repeat -RepetitionDuration $duration;
$settings = New-ScheduledTaskSettingsSet -AllowStartIfOnBatteries -DontStopIfGoingOnBatteries -StartWhenAvailable -RunOnlyIfNetworkAvailable -DontStopOnIdleEnd;
$task = Register-ScheduledTask -TaskName $jobname -Action $action -Trigger $trigger -RunLevel Highest -User $domainuser -Password $DomainPassword -Settings $settings;
Get-ScheduledTask "CreateSetNLB" | start-scheduledtask

$node = (Get-NlbClusterNode -ea:0) | where {$_.name -match $($env:computername)}
If (!$node){
	"Going Down"
	shutdown -r -t 8
} Else {
	"Healty Cluster"
}
